var title_f41_12_42185="ECG Torsades de pointes tutorial";
var content_f41_12_42185=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F53891%7ECARD%2F73827%7ECARD%2F60231&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F53891%7ECARD%2F73827%7ECARD%2F60231&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Single lead electrocardiogram (ECG) showing torsades de pointes",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 450px; height: 141px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This is an atypical, rapid, and bizarre form of ventricular tachycardia that is characterized by a continuously changing axis of polymorphic QRS morphologies.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Single lead electrocardiogram (ECG) showing torsades de pointes",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 420px; height: 119px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The electrocardiographic rhythm strip shows torsades de pointes, a polymorphic ventricular tachycardia associated with QT prolongation. There is a short, preinitiating RR interval due to a ventricular couplet which is followed by a long, initiating cycle resulting from the compensatory pause after the couplet.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Example of torsades de pointes and ventricular flutter",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 434px; height: 514px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown are three ECG leads (I, II, III); bradycardia and prolongation of the QT interval are present. Several runs of polymorphic ventricular tachycardia, called torsades de pointes (TdP) when associated with QT prolongation are seen (panel A); after several minutes, a rapid sustained ventricular tachycardia, sometimes called ventricular flutter, occurs (panel B). This is closely related to ventricular fibrillation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission by Samuel Levy, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
