"      </td>",
"      <td>",
"       Yes",
"      </td>",
"      <td>",
"       Yes",
"      </td>",
"      <td>",
"       Yes (prominent conjunctival injection and lacrimation)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\">",
