"      <td>",
"       Yes",
"      </td>",
"      <td>",
"       Occasional",
"      </td>",
"      <td>",
"       No",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\">",
"       Cutaneous triggers",
"      </td>",
"      <td>",
"       No",
"      </td>",
"      <td>",
"       Rare",
"      </td>",
"      <td>",
"       Yes",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\">",
